import React, { useState } from 'react';
import { Container, Row, Col, Tab, Nav } from 'react-bootstrap';
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import TrackVisibility from 'react-on-screen';
import projImg1 from '../assets/img/project-img1.png';
import projImg2 from '../assets/img/project-img2.png';
import projImg3 from '../assets/img/project-img3.png';
import meter1 from '../assets/img/team/Philippe-Team.png';
import meter2 from '../assets/img/team/Nathan-Team22.png';
import meter3 from '../assets/img/team/Killian-Team.png';
import meter4 from '../assets/img/team/Maxime-Team.png';
import meter5 from '../assets/img/team/Isaak-Team.png';
import meter6 from '../assets/img/team/Clement-Team.png';
import meter7 from '../assets/img/team/Quentin-Team.png';

export const Projects = () => {
  const meterImages = [
    { src: meter1, alt: 'Image', title: 'Web Development' },
    { src: meter2, alt: 'Image', title: 'Brand Identity' },
    { src: meter3, alt: 'Image', title: 'Logo Design' },
    { src: meter4, alt: 'Image', title: 'Web Development' },
    { src: meter5, alt: 'Image', title: 'Web Development' },
    { src: meter6, alt: 'Image', title: 'Web Development' },
    { src: meter7, alt: 'Image', title: 'Web Development' },
  ];

  // Function to preload images
  const preloadImages = (images) => {
    images.forEach((image) => {
      const img = new Image();
      img.src = image.src;
    });
  };

  // Call the preloadImages function with the meterImages array
  preloadImages(meterImages);

  const responsive = {
    superLargeDesktop: { breakpoint: { max: 4000, min: 3000 }, items: 1 },
    desktop: { breakpoint: { max: 3000, min: 1024 }, items: 1 },
    tablet: { breakpoint: { max: 1024, min: 464 }, items: 1 },
    mobile: { breakpoint: { max: 464, min: 0 }, items: 1 },
  };

  const [activeTab, setActiveTab] = useState('first');

  const handleTabChange = (tab) => {
    setActiveTab(tab);
  };

  return (
    <section className="project" id="projects">
      <Container>
        <Row>
          <Col>
            <TrackVisibility>
              {({ isVisible }) => (
                <div className={isVisible ? 'animate__animated animate__fadeIn' : ''}>
                  <h2>Projet</h2>
                  <p style={{ color: 'white' }}>
                    Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been
                    the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of
                    type and scrambled it to make a type specimen book.
                  </p>
                  <Tab.Container id="projects-tabs" activeKey={activeTab} onSelect={handleTabChange}>
                    <Nav
                      variant="pills"
                      className="nav-pills mb-5 justify-content-center align-items-center"
                      id="pills-tab"
                    >
                      <Nav.Item>
                        <Nav.Link eventKey="first">
                          <b>Web</b>
                        </Nav.Link>
                      </Nav.Item>
                      <Nav.Item>
                        <Nav.Link eventKey="second">
                          <b>Mobile</b>
                        </Nav.Link>
                      </Nav.Item>
                      <Nav.Item>
                        <Nav.Link eventKey="third">
                          <b>Mat√©riel</b>
                        </Nav.Link>
                      </Nav.Item>
                    </Nav>
                    <Tab.Content>
                      <Tab.Pane eventKey="first">
                        <Row>
                          <Col>
                            <div className="CarousselP-bx wow zoomIn">
                              <Carousel responsive={responsive} className="projectS-slider">
                                {meterImages.map((image, index) => (
                                  <div className="item" key={index}>
                                    <img src={image.src} alt={image.alt} />
                                    <h5>{image.title}</h5>
                                  </div>
                                ))}
                              </Carousel>
                            </div>
                          </Col>
                        </Row>
                      </Tab.Pane>
                      <Tab.Pane eventKey="second">
                        <Row>
                          <Col>
                            <div className="CarousselP-bx wow zoomIn">
                              <Carousel responsive={responsive} className="projectS-slider">
                                {meterImages.map((image, index) => (
                                  <div className="item" key={index}>
                                    <img src={image.src} alt={image.alt} />
                                    <h5>{image.title}</h5>
                                  </div>
                                ))}
                              </Carousel>
                            </div>
                          </Col>
                        </Row>
                      </Tab.Pane>
                      <Tab.Pane eventKey="third">
                        <Row>
                          <Col>
                            <div className="CarousselP-bx wow zoomIn">
                              <Carousel responsive={responsive} className="projectS-slider">
                                {meterImages.map((image, index) => (
                                  <div className="item" key={index}>
                                    <img src={image.src} alt={image.alt} />
                                    <h5>{image.title}</h5>
                                  </div>
                                ))}
                              </Carousel>
                            </div>
                          </Col>
                        </Row>
                      </Tab.Pane>
                    </Tab.Content>
                  </Tab.Container>
                </div>
              )}
            </TrackVisibility>
          </Col>
        </Row>
      </Container>
    </section>
  );
};
